import React, {useState} from "react";
function Home (){

    const [count, setCount] = useState(0);
    function counterUp(){

        setCount(count+1);

    }
    function counterDown(){

        setCount(count-1);

    }

    return (
        <div>
            <button onClick={counterUp}>click+</button>
            <button onClick={counterDown}>click-</button>
            <p>{count}</p>
        </div>
    )

}

export default Home;
